import React from "react";
import { Route, Routes, useNavigate } from "react-router-dom";

import GenericPage from "../components/GenericPage";

import NavBar from "../components/NavBar";
import Advertisement from "./Advertisement";
import Company from "./Company";
import User from "./User";
import Application from "./Application";

import TableHeaderComponent from "../components/TableHeader";
import TableInfo from "../components/TableInfo";
import EditButton from "../components/EditButton";
import DeleteButton from "../components/DeleteButton";
import CreateButton from "../components/CreateButton";

const AdvertisementTable = () => {
    const keysToDisplay = ["key1", "key2", "key3"];
    const displayedHeaders = {
        key1: "Header 1",
        key2: "Header 2",
        key3: "Header 3",
    };

    return (
        <div>
            <div>
                <NavBar />
                <Routes>
                    <Route path="/advertisement" element={<Advertisement />} />
                    <Route path="/company" element={<Company />} />
                    <Route path="/user" element={<User />} />
                    <Route path="/application" element={<Application />} />
                </Routes>
            </div>
            <div>
                {" "}
                <GenericPage
                    tableName="Advertisement Table"
                    tableHeaderComponent={
                        <TableHeaderComponent
                            endpoint="advertisement/monitor"
                            keysToDisplay={keysToDisplay}
                            displayedHeaders={displayedHeaders}
                        />
                    }
                    // tableInfoComponent={TableInfo}
                    // editButtonComponent={EditButton}
                    // deleteButtonComponent={DeleteButton}
                    // createButtonComponent={CreateButton}
                />
            </div>
        </div>
    );
};

export default AdvertisementTable;
